import CaseImage1 from '../../assests/case1.jpg'
import CaseImage2 from '../../assests/case2.jpg'
import CaseImage3 from '../../assests/case3.jpg'


const sliderElements = [
	{
		title: 'knowledge base',
		head: 'Success Stories',
		para: 'We work together across the globe to make a world of difference.',
		src : CaseImage1
	},

	{
		title: 'knowledge base',
		head: 'Success Stories',
		para: 'We work together across the globe to make a world of difference.',
		src : CaseImage2
	},

]

export default class casestudyslider extends Component {
    render() {
			const casesetting = {
				dots: false,
				infinite: true,
				speed: 500,
				slidesToShow: 1,
				autoplay: false,
				arrows: false,
				slidesToScroll: 1,
				beforeChange: function (currentSlide, nextSlide) {
					console.log("before change", currentSlide, nextSlide);
				},
				afterChange: this.handleAfterChange
			};
			return (
				<>
					<div className="container case-study">
						<div className="case-study-slider">
							<Slider ref={c => (this.slider = c)} {...casesetting}>
								<div>
										
								</div>
								<div>
									2
								</div>
							</Slider>
						</div>
					</div>	
				</>
			)
    }
}
